import { Dialog } from "@mui/material";


const dialogstyle={
    height:'96%',
    marginTop:'12%',
    width:'60%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overF
}
const LoginDialogue=()=>{

    return(
        <Dialog open={true} PaperProps={{sx: dialogstyle}}>
            Hello
        </Dialog>
    )
}
export default LoginDialogue;
